    false,nt"url": null,nt"notes": "This annual narrative report for Yukon
    Delta, Nunivak National Wildlife Refuge outlines Refuge accomplishments during the
    1982 calendar year.  The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses compliance with environmental and cultural resource mandates
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, pest control, and wilderness
    areas. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, marine mammals, fisheries resources, and marking and banding. The
    public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation. Items of interest are provided at the end.",nt"owner_org":
